specificData.forEach(async function (d) {
  let Product = {
    brand_name: d.brandName,
    list_price: parseFloat(d.currentSku.listPrice.split(' ')[0].split('$')[1]),
    sale_price: d.currentSku.salePrice? parseFloat(d.currentSku.salePrice.split(' ')[0].split('$')[1] || "0.00") : "0.00",
    display_name: d.displayName,
    image_alt_text: d.currentSku.imageAltText,
    hero_img: d.heroImage,
    more_colors: parseInt(d.moreColors),
    product_id: d.productId,
    rating: parseFloat(d.rating),
    reviews: parseInt(d.reviews),
    target_url: d.targetUrl,
    same_day_eligible: d.sameDayEligible,
    is_new: d.currentSku.isNew,
    is_best: d.currentSku.isBest,
    is_organic: d.currentSku.isOrganic,
    is_natural: d.currentSku.isNatural,
    sku_id: d.currentSku.skuId,
    is_sale: d.currentSku.salePrice?true:false
  };
  filterData.push(Product);
});


filterData.forEach((item) => {
  sidebarTopFilters.forEach((str) => {
    str = str.split(" ", 2)[0];
    if (
      item.display_name.includes(str) ||
      item.image_alt_text.includes(str)
    ) {
      item.product_type = str;
    }
  });
});


fs.writeFile("output.json", JSON.stringify(filterData), 'utf8', function (err) {
    if (err) {
        console.log("An error occured while writing JSON Object to File.");
        return console.log(err);
    }
 
    console.log("JSON file has been saved.");
});